import { Button, Container } from "react-bootstrap";
import { useState } from "react";

// GET SPACES
// - requires SPACE ID

// GET FOLDERLESS LISTS
// - requires SPACE ID

// GET LISTS
// - requires FOLDER ID

// GET TASKS
// - requires LIST ID

export default function ShowResponse() {
  function AllWorkspaces(key) {
    const [workspaces, setWorkspaces] = useState([]);

    var _apiKey = this.key;

    function GetWorkspaces() {
      fetch(`https://api.clickup.com/api/v2/team`, {
        method: "GET",
        headers: {
          Authorization: _apiKey,
        },
      })
        .then((response) => response.json())
        .then((json) => setWorkspaces(json))
        .catch((error) => console.error(error));
    }

    return workspaces;
  }

  function AllSpaces(key, workspaceId) {
    const [spaces, setSpaces] = useState([]);

    var _apiKey = this.key;
    var _teamId = this._teamId;

    function GetSpaces() {
      for (var i = 0; i <= _teamId.length; i++) {
        fetch(`https://api.clickup.com/api/v2/team/${_teamId[i]}/space`, {
          method: "GET",
          headers: {
            Authorization: _apiKey,
          },
        })
          .then((response) => response.json())
          .then((json) => setSpaces(json))
          .catch((error) => console.error(error));
      }

      return spaces;
    }
  }

  return (
    <Container>
      <Button
        onClick={() => {
          var ws = AllSpaces().GetSpaces();

          GetSpaces("12345", ws);
        }}
      >
        GET TRASH
      </Button>
      {trash ? (
        <pre>{JSON.stringify(GetSpaces().workspaces, null, 2)}</pre>
      ) : (
        "Loading..."
      )}
    </Container>
  );
}
